import React from "react";
import { useSelector } from "react-redux";

function Alert() {
  const { data } = useSelector((state) => {
    return state.alert;
  });
  return (
    data !== null &&
    data.length > 0 &&
    data.map((alert) => (
      <div key={alert.id} className={`alert alert-${alert.res.alertType}`}>
        {alert.res.msg}
      </div>
    ))
  );
}

export default Alert;
